import {CreateItem} from './models/items';

function App() {
  const [vals, setVals] = useState(0)

  return (
    <div className="container">
      <div className="App">

        <div>
          <br/>
          <CreateOrder vals={vals}/>
          <br/>
          <ListOrders setVals={setVals}/>
          <br/>
          <CreateClient/>
          <br/>
          <CreateItem/>
        </div>
      </div>
    </div>
  );
}

export default App;
